import "./App.css";
import Navbar from "./page/navbar";
import Product from "./page/products";
import Showcase from "./page/showcase";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Showcase />
      <Product />
    </div>
  );
}

export default App;
